import React, { useEffect, useState } from "react";
import "./App.css";
import { Routes, Route } from "react-router-dom";

// Component imports
import Welcome from "./pages/Welcome/Welcome";
import Signup from "./pages/Signup/Signup";
import Login from "./pages/Login/Login";
import ResetPassword from "./pages/ResetPassword/ResetPassword";
import ActiveChats from "./pages/ActiveChats/ActiveChats";
import ChatRoom from "./pages/ChatRoom/ChatRoom";
import Discover from "./pages/Discover/Discover";
import Profile from "./pages/Profile/Profile";
import Settings from "./pages/Settings/Settings";
import Parse from "parse";

// Initialize Parse
Parse.initialize(
  "XCuriaWlKUTt14yvNJVJ77kjQyC8yKFIOFqiVFck",
  "JxCHF3R5JB8VH3r8UXI9LCCEI14N3IdNIvrRhgIL"
); //PASTE HERE YOUR Back4App APPLICATION ID AND YOUR JavaScript KEY
Parse.serverURL = "https://parseapi.back4app.com/";

function App() {
  const [selectedUser, setSelectedUser] = useState("");

  useEffect(() => {}, []);

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Welcome />}></Route>
        <Route path="/signup" element={<Signup />}></Route>
        <Route path="/login" element={<Login />}></Route>

        <Route path="/resetpassword" element={<ResetPassword />}></Route>
        <Route path="/activechats" element={<ActiveChats />}></Route>
        <Route
          path="/chatroom"
          element={<ChatRoom selectedUser={selectedUser} />}
        ></Route>
        <Route
          path="/discover"
          element={<Discover setSelectedUser={setSelectedUser} />}
        ></Route>
        <Route path="/profile" element={<Profile />}></Route>
      </Routes>
    </div>
  );
}

export default App;
